import React from "react";
import {Album_Ban} from "./components/Ban";
import { Route } from "react-router-dom";

const Album = () => {
    return (
        <Router>
        <Route path="/al" element={<Album_Ban />}/>
        <Route path="/al:id" elemen/>
            {/* <Album_Ban /> */}
        </Router>
    )
}; // Album // 

export default Album;
